// Dashboard.js

import React, { useState, useEffect, useContext } from 'react';
import InProgressTaskList from './InProgressTaskList';
import DelayedTaskList from './DelayedTaskList';
import CompletedTaskList from './CompletedTaskList';
import EventCard from './EventCard';
import TaskList from './TaskList';
import TaskContext from './TaskContext'; // Import TaskContext

function Dashboard() {
  const [toDoTasks, setToDoTasks] = useState([]);
  const [inProgressTasks, setInProgressTasks] = useState([]);
  const [delayedTasks, setDelayedTasks] = useState([]);
  const [completedTasks, setCompletedTasks] = useState([]);
  const { sourceSection } = useContext(TaskContext); // Get sourceSection from TaskContext

  useEffect(() => {
    // Clear in progress, delayed, and completed tasks when toDoTasks change
    setInProgressTasks([]);
    setDelayedTasks([]);
    setCompletedTasks([]);
  }, [toDoTasks]);

  const handleDrop = (e, targetSection) => {
    e.preventDefault();
    const taskId = e.dataTransfer.getData('text/plain');

    // Identify the task and move it to the appropriate section
    const task = toDoTasks.find(task => task.id === taskId);
    if (task) {
      if (sourceSection !== targetSection) {
        // Remove the task from the source section
        setToDoTasks(toDoTasks.filter(task => task.id !== taskId));

        // Add the task to the target section
        switch (targetSection) {
          case 'inProgress':
            setInProgressTasks([...inProgressTasks, task]);
            break;
          case 'completed':
            setCompletedTasks([...completedTasks, task]);
            break;
          case 'delayed':
            setDelayedTasks([...delayedTasks, task]);
            break;
          default:
            break;
        }
      }
    }
  };

  const allowDrop = e => {
    e.preventDefault();
  };

  return (
    <div>
      <div className="dashboard">
        <aside className="sidebar">
          <h2>Upcoming Events</h2>
          <EventCard />
        </aside>
        <div className="main-section">
          <main className="main-content" style={{ height: "fit-content", width: "100%" }}>
            <h1>Main Content</h1>
            <p>This is the main content area of the dashboard.</p>
          </main>  
          <div style={{display: 'flex'}}>
            <div className="column">
              <div className="column-section" onDrop={e => handleDrop(e, 'inProgress')} onDragOver={allowDrop}>
                <h2>ToDo</h2>
                <TaskList tasks={toDoTasks} sourceSection="toDo" />
              </div>
            </div>
            <div className="column">
              <div className="column-section" onDrop={e => handleDrop(e, 'inProgress')} onDragOver={allowDrop}>
                <h2>InProgress</h2>
                <InProgressTaskList tasks={inProgressTasks} />
              </div>
            </div>
            <div className="column">
              <div className="column-section" onDrop={e => handleDrop(e, 'completed')} onDragOver={allowDrop}>
                <h2>Completed</h2>
                <CompletedTaskList tasks={completedTasks} />
              </div>
            </div>
            <div className="column">
              <div className="column-section" onDrop={e => handleDrop(e, 'delayed')} onDragOver={allowDrop}>
                <h2>Delayed</h2>
                <DelayedTaskList tasks={delayedTasks} />
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
